import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "House Rent", amount: 99.0, date: new Date(2023, 7, 29) },
    { title: "Grocery", amount: 20, date: new Date(2023, 7, 2) },
    { title: "School fees", amount: 125.5, date: new Date(2023, 7818) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0]} ></ExpenseItem>


    </div>
  );
}

export default App;
